import './MyPosts.css';
import Post from './Post/Post';

function MyPosts() {
	return (
		<div>
			My posts
			<div>
				<textarea></textarea>
				<button>Add Post</button>
			</div>
			<div className="posts">
				<Post />
				<Post /><Post />
			</div>
		</div>
	)
};

export default MyPosts;
